		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-164.54 y=-68.38 style=white-space:pre>OK, OK. I think I did learn a few things.  First, </tspan><tspan x=-164.54 y=-47.41 style=white-space:pre>I learned a little about how the OS virtualizes </tspan><tspan x=-164.54 y=-26.43 style=white-space:pre>the CPU. There are a bunch of important </tspan><tspan x=-164.54 y=-5.46 style=white-space:pre>mechanisms that I had to understand to make </tspan><tspan x=-164.54 y=15.51 style=white-space:pre>sense of this: traps and trap handlers, timer </tspan><tspan x=-164.54 y=36.49>interrupts, and how the OS and the hardware</tspan><tspan x=-164.54 y=57.46 style=white-space:pre> have to carefully save and restore state when</tspan><tspan x=-164.54 y=78.43 style=white-space:pre> switching between processes.</tspan></text>

<g transform="matrix(1 0 0 1 460.65 70)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-79.15 y=-26.43 style=white-space:pre>All those interactions </tspan><tspan x=-79.15 y=-5.46 style=white-space:pre>do seem a little </tspan><tspan x=-79.15 y=15.51 style=white-space:pre>complicated though; </tspan><tspan x=-79.15 y=36.49>how can I learn more?</tspan></text>
</g>
<g transform="matrix(0.92 0 0 0.92 317 193.01)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-139.21 y=-47.41 style=white-space:pre>Well, that’s a good question. </tspan><tspan x=-139.21 y=-26.43 style=white-space:pre>I think there is no substitute for doing; </tspan><tspan x=-139.21 y=-5.46 style=white-space:pre>just reading about these things doesn’t </tspan><tspan x=-139.21 y=15.51 style=white-space:pre>quite give you the proper sense. </tspan><tspan x=-139.21 y=36.49 style=white-space:pre>Do the class projects and I bet by the </tspan><tspan x=-139.21 y=57.46>end it will all kind of make sense.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 399.31 349.51)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-69.81 y=-15.95 style=white-space:pre>Sounds good. </tspan><tspan x=-69.81 y=5.03 style=white-space:pre>What else can I tell </tspan><tspan x=-69.81 y=26>you?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 329.68 482.49)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-95.18 y=-36.92 style=white-space:pre>Well, did you get some </tspan><tspan x=-95.18 y=-15.95 style=white-space:pre>sense of the philosophy of </tspan><tspan x=-95.18 y=5.03 style=white-space:pre>the OS in your quest to </tspan><tspan x=-95.18 y=26 style=white-space:pre>understand its basic </tspan><tspan x=-95.18 y=46.97>machinery?</tspan></text>
</g>

<g transform="matrix(1 0 0 1 390.46 121.92)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-200.96 y=-89.35 style=white-space:pre>Hmm... I think so. It seems like the OS is fairly paranoid. </tspan><tspan x=-200.96 y=-68.38 style=white-space:pre>It wants to make sure it stays in charge of the machine. </tspan><tspan x=-200.96 y=-47.41 style=white-space:pre>While it wants a program to run as efficiently as </tspan><tspan x=-200.96 y=-26.43>possible (and hence the whole reasoning behind</tspan><tspan x=-200.96 y=-5.46 style=white-space:pre> limited direct execution), the OS also wants to be </tspan><tspan x=-200.96 y=15.51 style=white-space:pre>able to say “Ah! Not so fast my friend” in case of an </tspan><tspan x=-200.96 y=36.49 style=white-space:pre>errant or malicious process. Paranoia rules the day, </tspan><tspan x=-200.96 y=57.46 style=white-space:pre>and certainly keeps the OS in charge of the machine. </tspan><tspan x=-200.96 y=78.43 style=white-space:pre>Perhaps that is why we think of the OS as a resource </tspan><tspan x=-200.96 y=99.4>manager.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 321.27 334.51)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-91.77 y=-15.95>Yes indeed — sounds like</tspan><tspan x=-91.77 y=5.03 style=white-space:pre> you are starting to put it </tspan><tspan x=-91.77 y=26>together! Nice.</tspan></text>

<g transform="matrix(1 0 0 1 271.78 62)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-102.28 y=-26.43 style=white-space:pre>And what about the policies </tspan><tspan x=-102.28 y=-5.46 style=white-space:pre>on top of those mechanisms </tspan><tspan x=-102.28 y=15.51 style=white-space:pre>— any interesting lessons </tspan><tspan x=-102.28 y=36.49>there?</tspan></text>
</g>
<g transform="matrix(0.91 0 0 0.91 347.03 216.19)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-181.01 y=-68.38>Some lessons to be learned there for sure.</tspan><tspan x=-181.01 y=-47.41 style=white-space:pre> Perhaps a little obvious, but obvious can be good. </tspan><tspan x=-181.01 y=-26.43 style=white-space:pre>Like the notion of bumping short jobs to the front </tspan><tspan x=-181.01 y=-5.46 style=white-space:pre>of the queue — I knew that was a good idea ever </tspan><tspan x=-181.01 y=15.51>since the one time I was buying some gum at the</tspan><tspan x=-181.01 y=36.49 style=white-space:pre> store, and the guy in front of me had a credit</tspan><tspan x=-181.01 y=57.46 style=white-space:pre> card that wouldn’t work. He had no short job, </tspan><tspan x=-181.01 y=78.43>let me tell you.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 323.33 366.51)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-85.83 y=-15.95 style=white-space:pre>That sounds oddly rude </tspan><tspan x=-85.83 y=5.03 style=white-space:pre>to that poor fellow. </tspan><tspan x=-85.83 y=26>What else?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 335.24 503.49)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-122.74 y=-36.92 style=white-space:pre>Well, that you can build a smart </tspan><tspan x=-122.74 y=-15.95 style=white-space:pre>scheduler that tries to be like SJF </tspan><tspan x=-122.74 y=5.03 style=white-space:pre>and RR all at once — that MLFQ </tspan><tspan x=-122.74 y=26 style=white-space:pre>was pretty neat. Building up a real </tspan><tspan x=-122.74 y=46.97>scheduler seems difficult.</tspan></text>
</g>

<g transform="matrix(1 0 0 1 329.14 69.49)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-167.64 y=-36.92 style=white-space:pre>Indeed it is. That’s why there is still </tspan><tspan x=-167.64 y=-15.95 style=white-space:pre>controversy to this day over which scheduler </tspan><tspan x=-167.64 y=5.03 style=white-space:pre>to use; see the Linux battles between CFS, </tspan><tspan x=-167.64 y=26 style=white-space:pre>BFS, and the O(1) scheduler, for example. </tspan><tspan x=-167.64 y=46.97>And no, I will not spell out the full name of BFS.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 418.45 196)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-120.95 y=-26.43 style=white-space:pre>And I won’t ask you to! These </tspan><tspan x=-120.95 y=-5.46>policy battles seem like they could</tspan><tspan x=-120.95 y=15.51 style=white-space:pre> rage forever; is there really a </tspan><tspan x=-120.95 y=36.49>right answer?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 379.13 350.46)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-139.63 y=-57.89 style=white-space:pre>Probably not. After all, even our </tspan><tspan x=-139.63 y=-36.92 style=white-space:pre>own metrics are at odds: if your </tspan><tspan x=-139.63 y=-15.95>scheduler is good at turnaround time,</tspan><tspan x=-139.63 y=5.03 style=white-space:pre> it’s bad at response time, and</tspan><tspan x=-139.63 y=26 style=white-space:pre> vice versa. As Lampson said, perhaps </tspan><tspan x=-139.63 y=46.97 style=white-space:pre>the goal isn’t to find the best solution, </tspan><tspan x=-139.63 y=67.94>but rather to avoid disaster.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 370.85 504.54)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-88.35 y=5.03>That’s a little depressing.</tspan></text>
</g>

<g transform="matrix(1.01 0 0 1.01 356.65 79.59)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-191.23 y=-47.41 style=white-space:pre>Good engineering can be that way. And it can also </tspan><tspan x=-191.23 y=-26.43 style=white-space:pre>be uplifting! It’s just your perspective on it, really. </tspan><tspan x=-191.23 y=-5.46>I personally think being pragmatic is a good thing, and</tspan><tspan x=-191.23 y=15.51 style=white-space:pre> pragmatists realize that not all problems have clean </tspan><tspan x=-191.23 y=36.49 style=white-space:pre>and easy solutions. Anything else that caught your </tspan><tspan x=-191.23 y=57.46>fancy?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 344.16 228.97)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-171.66 y=-47.41 style=white-space:pre>I really liked the notion of gaming the scheduler; </tspan><tspan x=-171.66 y=-26.43 style=white-space:pre>it seems like that might be something to look </tspan><tspan x=-171.66 y=-5.46 style=white-space:pre>into when I’m next running a job on Amazon’s </tspan><tspan x=-171.66 y=15.51 style=white-space:pre>EC2 service. Maybe I can steal some cycles </tspan><tspan x=-171.66 y=36.49 style=white-space:pre>from some other unsuspecting (and more </tspan><tspan x=-171.66 y=57.46>importantly, OS-ignorant) customer!</tspan></text>
</g>
<g transform="matrix(1 0 0 1 364.78 378)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-114.28 y=-26.43>It looks like I might have created</tspan><tspan x=-114.28 y=-5.46 style=white-space:pre> a monster! Professor </tspan><tspan x=-114.28 y=15.51>Frankenstein is not what I’d like</tspan><tspan x=-114.28 y=36.49 style=white-space:pre> to be called, you know.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 334.13 497)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-123.63 y=-26.43 style=white-space:pre>But isn’t that the idea? To get us </tspan><tspan x=-123.63 y=-5.46 style=white-space:pre>excited about something, so much </tspan><tspan x=-123.63 y=15.51 style=white-space:pre>so that we look into it on our own? </tspan><tspan x=-123.63 y=36.49>Lighting fires and all that?</tspan></text>
